import React from "react";

function footer(){
    return(
        <footer className="footer">
            <div className="team-info">
                <h2>Team</h2>
                <p>롸잇나우</p>
            </div>
            <div className="participants">
                <h2>Participants</h2>
                <p>PM 김다빈 박서연 Front-end 김가온 박수진 주민재 차예원</p>
                <p>Designer 김다빈 Back-end 손현수 신찬규 심수민 이현진</p>
            </div>
        </footer>
    );
}
export default footer;
